Insert into BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,CREATED_DATE) values (998,3,'The new mobile banking application is a major upgrade! It‚Äôs incredibly user-friendly, with a clean and modern design that makes navigation simple and intuitive. I really appreciate how fast it loads and how smooth the overall experience is. All essential services like balance checks, transfers, and bill payments are eas y to find and use. The added security features give me peace of mind, and the app runs reliably without crashes or glitches. It‚Äôs clear a lot of thought went into the user experi',5,to_date('21-APR-25','DD-MON-RR'),to_date('08-JUN-25','DD-MON-RR'));
Insert into BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,CREATED_DATE) values (999,3,'As an Internal Customer, Dashen Bank SuperApp has greatly simplified my online banking experience. It''s easy to use, allowing me to quickly check balances, transfer money and pay Bills. The app''s advanced security features are highly secure, ensuring my data is well protected. The Three click, Chat Banking and IPS features have also given me a smarter experience. In deed Dashen Bank is always steping ahead!',5,to_date('21-APR-25','DD-MON-RR'),to_date('08-JUN-25','DD-MON-RR'));
Insert into BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,CREATED_DATE) values (1000,3,'A truly impressive app ‚Äî user-friendly and a game-changer in Ethiopian banking. The Dashen Super App stands out as one of the most innovative and convenient digital banking solutions in Ethiopia‚Äôs financial history. Smooth navigation, seamless features, and a wide range of services all in one place. Well done!',5,to_date('21-APR-25','DD-MON-RR'),to_date('08-JUN-25','DD-MON-RR'));
Insert into BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,CREATED_DATE) values (1001,3,'dashen bank super up has very fast and convenience and also it has contain more things on one app .I am very interesting to use dashen bank super up',5,to_date('21-APR-25','DD-MON-RR'),to_date('08-JUN-25','DD-MON-RR'));
Insert into BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,CREATED_DATE) values (1002,3,'The Dashen Bank Super App has truly elevated my mobile banking experience. It''s fast, user-friendly, and packed with all the essential features. The interface is clean and intuitive, making navigation easy even for first-time users. I also appreciate the added security features that give me peace of mind while banking on the go. Dashen Bank has done an amazing job with this app‚Äîit‚Äôs reliable, efficient, and always improving. Highly recommended for anyone looking for seamless digital banking!',5,to_date('21-APR-25','DD-MON-RR'),to_date('08-JUN-25','DD-MON-RR'));
