Insert into BANK_REVIEWS.REVIEWS (REVIEW_ID,BANK_ID,REVIEW_TEXT,RATING,REVIEW_DATE,CREATED_DATE) values (1005,3,'The Dashen Super App offers a quick and user-friendly experience, bringing together a variety of services, like budgeting, payments, airtime recharges, and more, all in one convenient platform. Its sleek design and intuitive navigation ensure effortless transactions. It''s evident that Dashen Bank has carefully crafted the app to make everyday financial activities easier. A great choice for anyone aiming to streamline their digital routines!',5,to_date('21-APR-25','DD-MON-RR'),to_date('08-JUN-25','DD-MON-RR'));
